import React, { useState } from 'react';
import AppLayout from './app-layout';
import { 
  Users, Package, ShoppingCart, Settings, 
  Plus, Edit, Trash2, Search, FileText 
} from 'lucide-react';

const AdminDashboard = () => {
  const [activeTab, setActiveTab] = useState('vehicles');
  const [isFormOpen, setIsFormOpen] = useState(false);
  const [vehicles, setVehicles] = useState([]);
  const [filteredVehicles, setFilteredVehicles] = useState([]);
  const [searchQuery, setSearchQuery] = useState('');
  const [vehicleTypeFilter, setVehicleTypeFilter] = useState('all');
  const [editingVehicle, setEditingVehicle] = useState(null); // Ajout d'un état pour l'édition

  const handleAddVehicleClick = () => {
    setIsFormOpen(true); // Ouvrir le formulaire
  };

  const handleFormClose = () => {
    setIsFormOpen(false); // Fermer le formulaire
  };

  const handleFormSubmit = (vehicleData) => {
    setVehicles([...vehicles, vehicleData]);
    setIsFormOpen(false); // Fermer le formulaire après soumission
    filterVehicles(searchQuery, vehicleTypeFilter); // Appliquer les filtres après l'ajout
  };

  const filterVehicles = (searchQuery, vehicleTypeFilter) => {
    let filtered = [...vehicles];

    if (searchQuery) {
      filtered = filtered.filter(vehicle =>
        vehicle.name.toLowerCase().includes(searchQuery.toLowerCase())
      );
    }

    if (vehicleTypeFilter !== 'all') {
      filtered = filtered.filter(vehicle => vehicle.type === vehicleTypeFilter);
    }

    setFilteredVehicles(filtered);
  };

  const handleSearchChange = (e) => {
    const query = e.target.value;
    setSearchQuery(query);
    filterVehicles(query, vehicleTypeFilter); // Appliquer les filtres de recherche
  };

  const handleVehicleTypeChange = (e) => {
    const type = e.target.value;
    setVehicleTypeFilter(type);
    filterVehicles(searchQuery, type); // Appliquer les filtres de type
  };

  const handleEditClick = (vehicle) => {
    setEditingVehicle(vehicle); // Passer en mode édition
  };

  const handleCancelEdit = () => {
    setEditingVehicle(null); // Annuler l'édition
  };

  const handleSaveEdit = (vehicle) => {
    if (!vehicle.name || !vehicle.type || !vehicle.price || !vehicle.stock) {
      alert('Tous les champs doivent être remplis avant de valider.');
      return;
    }

    const updatedVehicles = vehicles.map(v =>
      v.id === vehicle.id ? vehicle : v
    );
    setVehicles(updatedVehicles);
    setEditingVehicle(null); // Sauvegarder et quitter le mode édition
    filterVehicles(searchQuery, vehicleTypeFilter);
  };

  return (
    <AppLayout>
      <div className="min-h-screen bg-gray-900">
        <div className="flex">
          {/* Sidebar */}
          <div className="w-64 bg-gray-800 min-h-screen p-4">
            <h2 className="text-xl font-bold text-blue-400 mb-6">Administration</h2>
            <nav className="space-y-2">
              <button
                onClick={() => setActiveTab('vehicles')}
                className={`w-full flex items-center space-x-2 px-4 py-2 rounded-lg ${
                  activeTab === 'vehicles' ? 'bg-blue-600' : 'hover:bg-gray-700'
                }`}
              >
                <Package className="h-5 w-5" />
                <span>Véhicules</span>
              </button>
              {/* Autres boutons... */}
            </nav>
          </div>

          {/* Main Content */}
          <div className="flex-1 p-6">
            {activeTab === 'vehicles' && (
              <div className="space-y-6">
                <div className="flex justify-between items-center">
                  <h2 className="text-2xl font-bold">Gestion des Véhicules</h2>
                  <button 
                    className="flex items-center px-4 py-2 bg-blue-600 rounded-lg hover:bg-blue-700"
                    onClick={handleAddVehicleClick}
                  >
                    <Plus className="h-5 w-5 mr-2" />
                    Ajouter un véhicule
                  </button>
                </div>

                <div className="flex gap-4">
                  <input
                    type="text"
                    placeholder="Rechercher un véhicule..."
                    value={searchQuery}
                    onChange={handleSearchChange}
                    className="w-full pl-10 pr-4 py-2 bg-gray-800 border border-gray-700 rounded-lg"
                  />
                  <select 
                    className="bg-gray-800 border border-gray-700 rounded-lg px-4"
                    value={vehicleTypeFilter}
                    onChange={handleVehicleTypeChange}
                  >
                    <option value="all">Tous les types</option>
                    <option value="car">Automobiles</option>
                    <option value="scooter">Scooters</option>
                  </select>
                </div>

                {/* Vehicles Table */}
                <div className="bg-gray-800 rounded-lg overflow-hidden">
                  <table className="w-full">
                    <thead>
                      <tr className="bg-gray-700">
                        <th className="px-6 py-3 text-left">ID</th>
                        <th className="px-6 py-3 text-left">Nom</th>
                        <th className="px-6 py-3 text-left">Type</th>
                        <th className="px-6 py-3 text-left">Prix</th>
                        <th className="px-6 py-3 text-left">Stock</th>
                        <th className="px-6 py-3 text-left">Actions</th>
                      </tr>
                    </thead>
                    <tbody className="divide-y divide-gray-700">
                      {filteredVehicles.map((vehicle, index) => (
                        <tr key={index}>
                          <td className="px-6 py-4">{index + 1}</td>
                          <td className="px-6 py-4">
                            {editingVehicle?.id === vehicle.id ? (
                              <input
                                type="text"
                                value={vehicle.name}
                                onChange={(e) => setEditingVehicle({ ...editingVehicle, name: e.target.value })}
                                className="bg-gray-700 text-white p-2 rounded"
                              />
                            ) : (
                              vehicle.name
                            )}
                          </td>
                          <td className="px-6 py-4">
                            {editingVehicle?.id === vehicle.id ? (
                              <input
                                type="text"
                                value={vehicle.type}
                                onChange={(e) => setEditingVehicle({ ...editingVehicle, type: e.target.value })}
                                className="bg-gray-700 text-white p-2 rounded"
                              />
                            ) : (
                              vehicle.type
                            )}
                          </td>
                          <td className="px-6 py-4">
                            {editingVehicle?.id === vehicle.id ? (
                              <input
                                type="number"
                                value={vehicle.price}
                                onChange={(e) => setEditingVehicle({ ...editingVehicle, price: e.target.value })}
                                className="bg-gray-700 text-white p-2 rounded"
                              />
                            ) : (
                              vehicle.price
                            )}
                          </td>
                          <td className="px-6 py-4">
                            {editingVehicle?.id === vehicle.id ? (
                              <input
                                type="number"
                                value={vehicle.stock}
                                onChange={(e) => setEditingVehicle({ ...editingVehicle, stock: e.target.value })}
                                className="bg-gray-700 text-white p-2 rounded"
                              />
                            ) : (
                              vehicle.stock
                            )}
                          </td>
                          <td className="px-6 py-4">
                            <div className="flex space-x-2">
                              {editingVehicle?.id === vehicle.id ? (
                                <>
                                  <button onClick={() => handleSaveEdit(editingVehicle)} className="p-2 bg-blue-600 hover:bg-blue-700 rounded">
                                    Sauvegarder
                                  </button>
                                  <button onClick={handleCancelEdit} className="p-2 bg-red-600 hover:bg-red-700 rounded">
                                    Annuler
                                  </button>
                                </>
                              ) : (
                                <button onClick={() => handleEditClick(vehicle)} className="p-2 hover:bg-gray-700 rounded">
                                  <Edit className="h-4 w-4" />
                                </button>
                              )}
                            </div>
                          </td>
                        </tr>
                      ))}
                    </tbody>
                  </table>
                </div>
              </div>
            )}
            {/* Autres sections... */}
          </div>
        </div>
      </div>
    </AppLayout>
  );
};

export default AdminDashboard;
